const Navigation = ({ prevFlashcard, nextFlashcard }) => {
    return (
      <div className="navigation">
        <button onClick={prevFlashcard}>Previous</button>
        <button onClick={nextFlashcard}>Next</button>
      </div>
    );
  };
  
  export default Navigation;
